import React , {Fragment} from 'react';
import {Provider} from 'react-redux'
import store from './store';
import Header from './commen/header';
import {GlobalStyle} from './style.js';


function App() {
  return (
  	<Provider store={store}>
	    <Fragment>
	      <GlobalStyle />
	      <Header />
	    </Fragment>
	  </Provider>
  );
}

export default App;
